import asyncio
import json
import websockets
import time

datauris = [ "","" ]

MAX_ITERATION = 200
INTERVAL = 0.01

async def accept(websocket, path):
    counter = 0
    while True:
        response = await websocket.recv()  
        print("receive : " + response) 
        data = json.loads(response)
        print(data) 
        while counter < MAX_ITERATION: 
            if data['request'] == 'start':
                counter = counter + 1
                print("start : " + data['filepath'] + ' - ' + str(counter))
                await websocket.send(json.dumps({'JPEG' : datauris[counter%2]}))
                time.sleep(INTERVAL)
            elif  data['request'] == 'stop':
                counter = MAX_ITERATION+1
                print("cancel")
            else:
                await websocket.send("echo : " + data)
        counter = 0


start_server = websockets.serve(accept, "localhost", 8080)
asyncio.get_event_loop().run_until_complete(start_server)
asyncio.get_event_loop().run_forever()


